function People({ data }) {
  return (
    <>
      <h1>People</h1>
      {data.map((people, i) => {
        return (
          <div key={i}>
            <p>{people.name} </p>
            <p>{people.height} </p>
            <p>{people.mass} </p>
          </div>
        );
      })}
    </>
  );
}

export default People;
